import React from 'react';

const InvitationCard = () => {
    return (
        <div className="invitation-card">
            <h1>You're Invited!</h1>
            <p>Join us for the wedding of</p>
            <h2>John Doe & Jane Smith</h2>
            <p>On Saturday, the 25th of June, 2023</p>
            <p>At 4:00 PM</p>
            <p>St. Mary's Church</p>
            <p>123 Wedding Lane</p>
            <p>City, State</p>
            <h3>RSVP by June 1st</h3>
            <p>Email: rsvp@example.com</p>
        </div>
    );
};

export default InvitationCard;
